import "./App.css";

import { ThemeProvider, createTheme } from "@mui/material/styles";

import Header from "./components/Header";

function App() {
  const theme = createTheme({
    typography: {
      //fontFamily: "Nanum Gothic",
    },
    palette: {
      primary: {
        main: "#556cee",
      },
      secondary: {
        main: "#909ff1",
      },
    },
  });

  return (
    <>
      <ThemeProvider theme={theme}>
        <Header />
      </ThemeProvider>
    </>
  );
}

export default App;
